for (let index = 0; index < msg.payload.length; index++) {
    const data = new Date(msg.payload[index].created);
    const umanDate = "" + ((data.getDate() < 10 ? '0' : '') + data.getDate()) + "/" +
                    (((data.getMonth()+1) < 10 ? '0' : '') + (data.getMonth()+1)) + "/" +
                    data.getFullYear() + " " +
                    ((data.getHours() < 10 ? '0' : '') + data.getHours()) + ":" +
                    ((data.getMinutes() < 10 ? '0' : '') + data.getMinutes())  + ":" +
                    ((data.getSeconds() < 10 ? '0' : '') + data.getSeconds());
    msg.payload[index].created = umanDate;
    if(!(msg.payload[index].start) && !(msg.payload[index].stop)) {
        msg.payload[index].state = "ready"
    }
    else if((msg.payload[index].start) && !(msg.payload[index].stop)) {
        msg.payload[index].state = "running"
    }
    else if((msg.payload[index].start) && (msg.payload[index].stop)) {
        msg.payload[index].state = "executed"
    }
}

return msg;

msg.options = [];
